import React, { Component } from 'react';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Form from 'react-bootstrap/Form';
import Button from 'react-bootstrap/Button';

class RoleForm extends Component {
    render (){
        return (
            <div>
                <Form className="roleform">
                <hr/>
                    <Row>
                        <Col>
                          <Form.Control className="custom" placeholder="Enter Name" />
                        </Col>
                        <Col>
                          <Form.Control className="custom" placeholder="Enter role type" />
                        </Col>
                        <Col>
                          <Form.Control className="custom" placeholder="Enter description" />
                        </Col>
                        <Col>
                            <Button onClick={this.showformHandler}>ADD ROLE</Button>
                        </Col>
                    </Row>
                </Form>
            </div>
        )
    }
}

export default RoleForm;
